import React from 'react';
import { Switch, Route } from 'react-router-dom';
import About from 'components/about/About';
import Resume from 'components/resume/Resume';

const MainRouter = () => (
	<Switch>
		<Route 
			exact path="About"
			component={About} />
		<Route 
			exact path="Resume"
			component={Resume} />
	</Switch>
);

export default MainRouter;
